import React from "react";

export default function About() {
    return(
        <div className="About">
            <h1>Created By:</h1><br/><br />
            <p><b>Vaibhav Chaudhary</b></p><br />
            <p>Second Year Computer Science Engineering Student at Manipal University Jaipur.</p><br></br>
            <p>Contact Me at : +91-9319150688</p><br /><br/>
            <h1><b>Social:</b></h1>
            
            <a href="https://github.com/livelong99"><img src="./Images/github-image.png" ></img></a>
            <a href="https://www.linkedin.com/authwall?trk=gf&trkInfo=AQHHVc9POt_TbQAAAXFOrI-ARlHgyh6aA6jXi_t6zzscDri2PZPfjn8XkTWQagiOqj4DX5c-OQ-3RQcPGHo0VGLxPoLDPz-h_AY7BDdXacggEGBW4EFiZU5TuooSOLyNRGIg1c0=&originalReferer=&sessionRedirect=https%3A%2F%2Fwww.linkedin.com%2Fin%2Fvaibhav-chaudhary-b94882194"><img src="./Images/linkedin.png" ></img></a>
        </div>
    )
}
